import React from 'react';
import logo from '../logo.svg';
import styles from '../css/ProjectCard.module.css';
import {Tag} from './Tag';

export function ProjectCard() {
  return (
    <button className={styles.ProjectCard}>
        <img src={logo} className={styles.projectImage}/>
        <div className={styles.ProjectInfo}>
          <div className={styles.Title}>Projekt testowy</div>
          <Tag/>
          <Tag/>
        </div>
        
    </button>
  );
}
